                 secrets: &SessionSecrets)
                 -> MessageCipherPair {
    // Make a key block, and chop it up.
    // nb. we don' t implement any ciphersuites with nonzero mac_key_len . let key_block = secrets . make_key_block scs . key_block_len ; let mut offs = 0 ; let client_write_key = & key_block [ offs . . offs + scs . enc_key_len ] ; offs += scs . enc_key_len ; let server_write_key = & key_block [ offs . . offs + scs . enc_key_len ] ; offs += scs . enc_key_len ; let client_write_iv = & key_block [ offs . . offs + scs . fixed_iv_len ] ; offs += scs . fixed_iv_len ; let server_write_iv = & key_block [ offs . . offs + scs . fixed_iv_len ] ; offs += scs . fixed_iv_len ; let explicit_nonce_offs = & key_block [ offs . . offs + scs . explicit_nonce_len ] ; let write_key , write_iv = if secrets . randoms . we_are_client { client_write_key , client_write_iv } else { server_write_key , server_write_iv } ; let read_key , read_iv = if secrets . randoms . we_are_client { server_write_key , server_write_iv } else { client_write_key , client_write_iv } ; let aead_alg = scs . get_aead_alg ; match scs . bulk { BulkAlgorithm :: AES_128_GCM | BulkAlgorithm :: AES_256_GCM => { Box :: new GCMMessageDecrypter :: new aead_alg , read_key , read_iv , Box :: new GCMMessageEncrypter :: new aead_alg , write_key , write_iv , explicit_nonce_offs } BulkAlgorithm :: CHACHA20_POLY1305 => { Box :: new ChaCha20Poly1305MessageDecrypter :: new aead_alg , read_key , read_iv , Box :: new ChaCha20Poly1305MessageEncrypter :: new aead_alg , write_key , write_iv } } } pub fn new_tls13_read scs : & 'static SupportedCipherSuite,
                      secret: &[u8]) -> Box<MessageDecrypter> {
    let hash = scs.get_hash();
    let key = derive_traffic_key(hash, secret, scs.enc_key_len);
    let iv = derive_traffic_iv(hash, secret, scs.fixed_iv_len);
    let aead_alg = scs.get_aead_alg();

    Box::new(TLS13MessageDecrypter::new(aead_alg, &key, &iv))
}

