    alg: &' static ring :: aead :: Algorithm , enc_key : ring :: aead :: SealingKey , enc_offset : [ u8 ; 12 ] , } struct TLS13MessageDecrypter { alg : & 'static ring::aead::Algorithm,
    dec_key: ring::aead::OpeningKey,
